import React from "react";
import Tvs from "./Lap";

const Projectors = (props) => {
  return (
    <>
      {props.projectors.map((projectors, idx) => (
        <Tvs key={idx} projectors={projectors} />
      ))}
    </>
  );
};

export default Projectors;
